function pairElement(str) {
  const elements = str.split('');
  let result = [];

  for(let i = 0; i < elements.length; i++) {
  	if (elements[i] === 'A') {
    	result.push(['A', 'T'])
    } else if (elements[i] === 'T') {
    	result.push(['T', 'A'])
    } else if (elements[i] === 'C') {
    	result.push(['C', 'G'])
    } else {
    	result.push(['G', 'C'])
    }
  }
  return result;
}

